import { BLANK_IMAGE_URL } from "@configs";
import styled from "styled-components";

export const RewardItem = () => {
    return (
        <StyledContainer>
            <img src={BLANK_IMAGE_URL} />
            <div className="desc">Premium Korean Banana Fried Small Package</div>
        </StyledContainer>
    );
};

const StyledContainer = styled.div`
    width: 209px;
    img {
        width: 100%;
        height: 209px;
        object-fit: contain;
    }
    .desc {
        font-weight: normal;
        font-size: 15px;
        line-height: 20px;
        color: #000000;
    }
`;
